    22: "New York Giants",
    23: "New York Jets",
    24: "Oakland Raiders",
    25: "Philadelphia Eagles",
    26: "Pittsburgh Steelers",
    27: "San Francisco 49ers",
    28: "Seattle Seahawks",
    29: "Tampa Bay Buccaneers",
    30: "Tennessee Titans",
    31: "Washington Redskins"
}

function DraftCard(props) {


    return (
        <Card className="teamCard">
            <Card.Body> {props.value} </Card.Body>
        </Card>
    )



}

class generateList extends React.Component {

    constructor(props) {
        super(props)

        this.state = {
            orderTeams: Array(32).fill(null),
            orderPlayers: Array(32).fill(null),
        }

    }

    renderTeamCard(i) {
        return <DraftCard value={i}/>;
    }

}

function Mock() {

    return (
        <div className="draftTable">
            <Container>
                <Table responsive>
                    <thead>
                        <tr>
                            <th>Team</th>
                            <th>Player</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <th> <DraftCard /> </th>
                            <th> Joe Burrow </th>
                        </tr>
                    </tbody>
                </Table>

            </Container>
        </div>
    );
}

export default Mock;
